import React from 'react';
import { Link } from 'react-router-dom';

const nav = {
    display: 'flex',
    justifyContent: 'space-around',
    alignItems: 'center',
    height: '6vw',
    maxHeight: '50px',
    minHeight: '40px',  
    padding: '3px 0 0 0',
}

const navLinks = {

}

const links = {

}

const linkText = {

}

function BottomNav() {
    return (
        <div className="bottomNav">
            <nav style={ nav }>
                <ul style={ navLinks }>
                    <Link style={links} to='/'>
                        <div style={ linkText }>HOME</div>
                    </Link>
                    <Link style={links} to='/about'>
                        <div style={ linkText }>ABOUT</div>
                    </Link>
                    <Link style={links} to='/services'>
                        <div style={ linkText }>SERVICES</div>
                    </Link>
                    <Link style={links} to='/projects'>
                        <div style={ linkText }>OUR PROJECTS</div>
                    </Link>
                    <Link style={links} to='/contact'>
                        <div style={ linkText }>CONTACT</div>
                    </Link>
                </ul>
            </nav>
        </div>
    );
}

export default BottomNav;
